import React from 'react';
import { useSelector } from 'react-redux';
import {  Typography } from '@material-ui/core/';

import useStyles from './styles';

const Sensors = ({ setCurrentId }) => {
  const sensors = useSelector((state) => state.posts);
  const classes = useStyles();

  return (

    <Typography className={classes.heading} variant="h4" align="center">{sensors.channel}{sensors.feeds}</Typography>
    
  );
};

export default Sensors;
